import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import HomeScreen from './Screen/HomeScreen';
import AppDetailsScreen from './Screen/AppDetailsScreen';
import { Text, Image } from 'react-native'; // Importa Text desde 'react-native'

const Stack = createStackNavigator();

import Logo from './assets/logo.png'; // AsegÃºrate de que la ruta sea correcta

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Home">
        <Stack.Screen
          name="Home"
          component={HomeScreen}
          options={{
            headerTitle: () => (
              <Image source={Logo} style={{ width: 40, height: 40 }} />
            ),
          }}
        />
        <Stack.Screen name="AppDetails" component={AppDetailsScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
